import React, { Component } from 'react';
import ReactVivus from 'react-vivus';

import all from '../SVG/ALL.svg'


class Tech extends Component {
  render() {
    return (
        <div style={{"width":"100%","height":"100vh","backgroundColor":"#33466b", "textAlign":"center"}}>
        <div style={{"width":"50%","top":"500","display":"inline,","margin":"auto"}}>
        <ReactVivus
          id="all"
          option={{
            file: all,
          }}
          style={{ height: '100%%', width: '100%'}}
          callback={console.log}
        />
        </div>
          <div style={{"width":"50%","top":"500","display":"inline","margin":"auto"}}>
          <ReactVivus
            id="all"
            option={{
              file: all,
            }}
            style={{ height: '100%%', width: '100%'}}
            callback={console.log}
          />
          </div>
        </div>
    )
  }
}

export default Tech;
